import React, { Component } from 'react'
import {Grid, GridRow } from 'semantic-ui-react'

export default class EPicnics extends Component {

    DESCRIPTION = [
        'We host E-Picnics once per semester. Come for music, free beer (for upperclassmen), and free food (for everyone). This event is also when we hand out our famous E-Picnic t-shirts that all make all the Trinity students jealous.'
    ]
    render(){
        return(
            <div className='ePicnic'>
                <Grid>
                    <GridRow>
                        <div>{this.DESCRIPTION}</div>
                    </GridRow>
                </Grid>
            </div>
        )
    }
}
